# Name: Dorothy Philip# 2016-2017 Contest #1# Problem : ACSL Agram JUNIOR DIVISION# Language: Python 3.6 def Deal(lead_suit, lead_number, dealer_cards) :    result = 10    y = dealer_cards[lead_suit]    h = 10    s = 10    for c in y :        if  c > lead_number :            if c < h :                h = c        else:            if c < s:                s = c    if s == 10 and h == 10 :        return 'NONE'    elif h < 10 :        return str(h) + ', ' + lead_suit    elif s < 10 :        return str(s) + ', ' + lead_suitdef form_DC_dict(a) :    d = {'D': [], 'S':[], 'C':[], 'H':[]}    for i in range(5) :        i1 = i * 2        i2 = i1 + 1        value = int(a[i1])        suit = a[i2]        d[suit].append(value)    return dresults = []    for i in range(5):    userinput = input()    data = userinput.split(', ')    a = int(data[0])    b = data[1]    d = data[2:]    c = form_DC_dict(d)    r = Deal(b, a, c)    results.append(r)for i in range(5) :    print(results[i])